import React from 'react';
import Navbar from '../components/NavBar';
import Sidebar from './Sidebar';
// import ProductList from './ProductList'; // Component to list products
// import UserList from './UserList';       // Component to list users
// import AddProduct from './AddProduct';    // Component to add products
// import ViewBookings from './ViewBookings'; // Component to view bookings
// import ViewFeedback from './ViewFeedback'; // Component to view feedback
// import CategoryList from './CategoryList'; // Component to manage categories
import { Routes, Route } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div style={{ flex: 1 }}>
      <Navbar />
      <div style={{ display: 'flex' }}>
        <Sidebar />
        <div style={{ padding: '20px', flex: 1 }}>
          <Routes>
            {/* <Route path="/" element={<ProductList />} /> */}
            {/* <Route path="/users" element={<UserList />} /> */}
            {/* <Route path="/add-product" element={<AddProduct />} /> */}
            {/* <Route path="/view-bookings" element={<ViewBookings />} /> */}
            {/* <Route path="/view-feedback" element={<ViewFeedback />} /> */}
            {/* <Route path="/categories" element={<CategoryList />} /> */}
            {/* Add more routes as necessary */}
          </Routes>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
